syntax = "proto2";

package main;

import "github.com/gogo/protobuf/gogoproto/gogo.proto";

option (gogoproto.populate_all) = true;
option (gogoproto.gostring_all) = true;
option (gogoproto.description_all) = true;

message PuddingMilkshake {
    option (gogoproto.description) = true;
    optional FinanceJudo FinanceJudo = 1;
    optional MudRiddle RainInterlude = 2;
}

message FinanceJudo {
    option (gogoproto.description) = true;
    optional SaladWorry SaladWorry = 1;
    optional int64 RumourSpirit = 2;
    optional int64 UserInterfaceSpanner = 3;
}

message SaladWorry {
    optional bytes MeasureGrade = 1;
    optional KeyQueen HooliganValley = 2;
    repeated string MagazineFrame = 3;
    optional XrayPilot XrayPilot = 4;
    optional bool LogMicrophone = 5;
    optional MicrobeMiser NeonLightEnd = 6;
    optional string LeafTrellis = 7;
    optional CancerUserExperience CancerUserExperience = 8;
    optional RadarBox RadarBox = 9;
    optional bool AccidentStadium = 10;
    optional SpyCarpenter SpyCarpenter = 11;
    optional string PrizeRemoteControl = 12;
    optional TravelBallRoom TableScandal = 13;
    repeated uint32 StormTermite = 14;
    repeated bytes ParliamentChime = 15;
}

message KeyQueen {
    repeated int32 SkyscraperUniversity = 1;
    repeated bytes RevengeMirror = 2;
    repeated uint64 TrailerGallery = 3;
}

message TravelBallRoom {
    repeated AccountantPowder DanceShooting = 1;
    repeated string ReasonCoat = 2;
}

message SpyCarpenter {
    repeated uint32 PartyBrakes = 1;
    repeated uint32 WireOyster = 2;
    optional XrayPilots XrayPilots = 3;
    repeated PlasticBagCertificate RussiaBasket = 4;
    optional StarTusk AccidentStockMarket = 5;
    optional StarTusk BulldozerHandkerchief = 6;
    repeated WineMicroscope VelcroBench = 7;
    repeated string BridgePepper = 8;
    repeated string FountainTarget = 9;
    repeated string SoleFin = 10;
    optional MigraneLemonade MigraneLemonade = 11;
    repeated uint32 WhaleColour = 12;
    repeated bytes LawyerRumour = 13;
    repeated uint32 ToothSale = 14;
    repeated bytes PearLeader = 15;
}

message StarTusk {
    repeated AltarPlastic ViolinDuty = 1;
    repeated string CloakPlayground = 2;
}

enum AltarPlastic {
    Table = 0;
    Dusk = 1;
    Drum = 2;
    Cereal = 3;
    Prophet = 4;
}

message MigraneLemonade {
    repeated ArchBubble ArchBubbles = 1;
    repeated string FactParrot = 2;
}


enum ArchBubble {
    Aroma = 0;
    Moustache = 1;
    Cup = 2;
    Toes = 3;
    Seal = 4;
}


