enum CancerUserExperience {
    Nun = 0;
    Massage = 1;
    Cough = 2;
    Artillery = 3;
    Cashier = 4;
}


message MudRiddle {
    optional XrayPilots XrayPilots = 1;
    repeated uint32 RunwayGenius = 2;
    optional BingleDaisy BingleDaisy = 3;
    repeated uint32 Merit = 4;
    repeated string CreationBirthday = 5;
    repeated string HardwareFood = 6;
    repeated string TurkeyValley = 7;
    repeated string TramPuppet = 8;
