}

message XrayPilot {
    optional int64 AnkleCoat = 1;
    optional int64 ShelfSunglass = 2;
    optional int64 BacteriaPaperclip = 3;
}

message XrayPilots {
    repeated uint64 AnkleCoats = 1;
    repeated uint64 ShelfSunglasses = 2;
    repeated uint64 BacteriaPaperclips = 3;
}

message BingleDaisy {
    repeated AccountantPowder AccountantPowders = 1;
    repeated uint32 DecoratorTask = 2;
    repeated bytes TailTable = 3;
    repeated string MachineCurtain = 4;
